  render() {
    return (
      <>
        <ScrollLock isActive={this.props.lockScroll}>
        <div className="flex h-screen bg-gradient-to-r from-green-400 to-blue-500 items-center justify-evenly" style={{scrollSnapStop: 'always'}}>
